import React from "react";
import Todo from "./Todo.js";
class TodoList extends React.Component {
	constructor(props) {
		super(props);
		console.log(props.todos);
	}
	render() {
		return (
			<>
				<Todo />
				<Todo />
				<Todo />
				<Todo />
				<Todo />
				<Todo />
			</>
		);
	}
}

export default TodoList;
